// ==UserScript==
// @name         Pawn2Prawn
// @version      2024-11-17
// @description  chess mod
// @author       petderek
// @match        https://lichess.org/*
// @icon         https://www.google.com/s2/favicons?sz=64&domain=tampermonkey.net
// @grant        GM_addStyle
// ==/UserScript==

(function() {
    'use strict';
    GM_addStyle(`
      .pawn.white {
         background-image: url('data:image/png;base64,') !important;
      }
      .pawn.black {
         filter: invert(.7);
         background-image: url('data:image/png;base64,') !important;
      }
    `);
})();
